interface IProps {
    children: ReactNode;
    // any other props that come into the component
    IMG: any
  }

function IMG ({IMG} : IProps) {
   

const IMGs = IMG;

console.log(IMGs)

     
        return (
            <div>
                <ul className=" w3-card pagination justify-items-center justify-center">
      {IMGs.map((art:any) => (
          <div className="w3-card ">
          <img className=" w3-card w3-left img6  " src={art.urls.thumb}/>  
      <p>{art.alt_description}</p>
          </div>
         
       
        ))}
         </ul>
         
            </div>
        )
    
}


export default IMG

export async function getServerSideProps () {

    const API = await fetch ("https://api.unsplash.com/users/samuelzeller/photos/client_id=KkBgR-UR5bzc26yPltIXqo_Jsd5f-h2Hv_rL4zzpG2k")

    const IMG = await API.json();

    return{
        props :{
           IMG,
        }
    }
    
}
